import React from 'react';
import { PostSection, PostTitle } from './styledComponent';

const WritePost = () => {
    return (
        <PostSection>
            <PostTitleDiv>
            <PostTitle>
                글쓰기
            </PostTitle>
            </PostTitleDiv>
            <PostWriteDiv>
                <TitleInput placeholder="제목을 입력해주세요. (15자 이내)"/>
                <ContentsInput cols="30" rows="10"></ContentsInput>
            </PostWriteDiv>
            <PostSubmition>
                <PostSubmit>작성완료</PostSubmit>
            </PostSubmition>
        </PostSection>
    );
};

export default WritePost;
